namespace War
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Battlefield battlefield = new Battlefield();

            battlefield.Work();
        }
    }

    class Battlefield
    {
        public void Work()
        {
            Platoon platoonRed = new Platoon();
            Platoon platoonWhite = new Platoon();
         
            while (platoonRed.IsArmyDefeated() == false && platoonWhite.IsArmyDefeated() == false)
            {
                Console.WriteLine("Битва между белой и красной армиями.");

                Console.WriteLine("Состав армии белых:");

                platoonWhite.UpdateArmy();

                platoonWhite.ShowArmy();

                Console.WriteLine("\nСостав армии красных:");

                platoonRed.UpdateArmy();

                platoonRed.ShowArmy();

                Console.WriteLine();

                Console.WriteLine("Нажмите на любую клавишу для атаки:");
                Console.ReadKey();

                platoonRed.Attack(platoonWhite);

                platoonWhite.Attack(platoonRed);


                Console.Clear();
            }

            if (platoonWhite.IsArmyDefeated())
            {
                Console.WriteLine("Красная армия победила.");
            }
            else if (platoonRed.IsArmyDefeated())
            {
                Console.WriteLine("Белая армия победила.");
            }
            else
            {
                Console.WriteLine("Обе армии потерпели поражение.");
            }
        }
    }

    class Platoon
    {
        const int NumberOfSoldersInPlatoon = 20;

        private List<Solder> _typeSolders = new List<Solder>();
        private List<Solder> _army = new List<Solder>();

        public Platoon()
        {
            _typeSolders.Add(new Ordinary());
            _typeSolders.Add(new Paratrooper());
            _typeSolders.Add(new Artilleryman());
            _typeSolders.Add(new Gunner());

            CreateArmy();
        }

        public bool IsArmyDefeated()
        {
            if (_army.Count == 0)
            {
                return true;
            }
            else
            {
                return false;
            }
        }

        public void UpdateArmy()
        {
            for (int i = 0; i < _army.Count; i++)
            {
                if (_army[i].Healt <= 0)
                {
                    _army.Remove(_army[i]);

                    i--;
                }
            }
        }

        public void Attack(Platoon defenderPlatoon)
        {
            foreach (Solder solder in defenderPlatoon._army)
            {
                solder.Attack(defenderPlatoon._army);
            }
        }

        public void ShowArmy()
        {
            Console.WriteLine("Список военных:");

            foreach (Solder solder in _army)
            {
                Console.WriteLine($"{solder.Name} - H|{solder.Healt}|");
            }
        }

        private void CreateArmy()
        {
            for (int i = 0; i < NumberOfSoldersInPlatoon; i++)
            {
                _army.Add(_typeSolders[UserUnits.GenerateRandomNumber(0, _typeSolders.Count)]);
            }
        }

    }

    abstract class Solder
    {
        public Solder(int health, int damage, int arma, string name)
        {
            Healt = health;
            Damage = damage;
            Arma = arma;
            Name = name;
        }

        public int Healt { get; private set; }
        public int Damage { get; private set; }
        public int Arma { get; private set; }
        public string Name { get; private set; }

        virtual public void TakeDamage(int damage)
        {
            if (Arma > 0)
            {
                Healt -= Damage - Arma;
            }
            else
            {
                Healt -= damage;
            }
        }

        virtual public void Attack(List<Solder> defenterArmy)
        {
            defenterArmy[ChooseRandomIndexSolder(defenterArmy)].TakeDamage(Damage);
        }

        virtual public int ChooseRandomIndexSolder(List<Solder> defenterArmy)
        {
            return UserUnits.GenerateRandomNumber(0, defenterArmy.Count);
        }
        virtual public int GetNumberOfDefenterAttack(int minNumberOfDefenterAttack, int maxNumberOfDefenterAttack)
        {
            return UserUnits.GenerateRandomNumber(minNumberOfDefenterAttack, maxNumberOfDefenterAttack + 1);
        }

        abstract public Solder Clone();
    }

    class Ordinary : Solder
    {
        public Ordinary() : base(200, 10, 2, "Рядовой")
        {

        }

        public override Solder Clone()
        {
            return new Ordinary();
        }
    }

    class Paratrooper : Solder
    {
        private int _damageMultiplier = 2;

        public Paratrooper() : base(300, 10, 3, "Десантник")
        {

        }

        public override void Attack(List<Solder> defenterArmy)
        {
            int indexOfDefenderAttack = base.ChooseRandomIndexSolder(defenterArmy);

            defenterArmy[indexOfDefenderAttack].TakeDamage(Damage * _damageMultiplier);
        }

        public override Solder Clone()
        {
            return new Paratrooper();
        }
    }

    class Artilleryman : Solder
    {
        private int minNumberOfDefenterAttack = 1;
        private int maxNumberOfDefenterAttack = 5;

        public Artilleryman() : base(150, 20, 1, "Артиллерист")
        {

        }

        public override void Attack(List<Solder> defenterArmy)
        {
            List<int> indexesOfDefenderAtack = ChooseIndexesOfDefenterAttack(defenterArmy);

            foreach (int index in indexesOfDefenderAtack)
            {
                defenterArmy[index].TakeDamage(Damage);
            }
        }

        public override Solder Clone()
        {
            return new Artilleryman();
        }

        private List<int> ChooseIndexesOfDefenterAttack(List<Solder> defenderArmy)
        {
            List<int> indexesOfAttackDefender = new List<int>();
            int indexOfRandomDefender = 0;

            int numberOfDefenderAttack = base.GetNumberOfDefenterAttack(minNumberOfDefenterAttack, maxNumberOfDefenterAttack);

            for (int i = 0; i < numberOfDefenderAttack; i++)
            {
                while (indexesOfAttackDefender.Contains(indexOfRandomDefender))
                {
                    indexOfRandomDefender = base.ChooseRandomIndexSolder(defenderArmy);
                }

                indexesOfAttackDefender.Add(indexOfRandomDefender);
            }

            return indexesOfAttackDefender;
        }
    }

    class Gunner : Solder
    {
        private int minNumberOfDefenterAttack = 3;
        private int maxNumberOfDefenterAttack = 10;

        public Gunner() : base(400, 7, 5, "Пулеметчик")
        {

        }

        public override void Attack(List<Solder> defenterArmy)
        {
            int numberOfDefenderAtack = base.GetNumberOfDefenterAttack(minNumberOfDefenterAttack, maxNumberOfDefenterAttack);

            for (int i = 0; i < numberOfDefenderAtack; i++)
            {
                base.Attack(defenterArmy);
            }
        }

        public override Solder Clone()
        {
            return new Gunner();
        }
    }

    class UserUnits
    {
        private static Random s_random = new Random();

        public static int GenerateRandomNumber(int min, int max)
        {
            return s_random.Next(min, max);
        }
    }
}
